import React from 'react';
import './HeroSection.css';

import '../App.css';

function AboutUs() {
  return (
    <div className='hero-container'>
      <video src='./videos/CyberTEchDemo.mp4' autoPlay loop muted />
      <video src='./videos/Demoday.mp4' autoPlay loop />

      <figure className='image-container'>
        <img src='./images/Peoplechoice.jpg' alt='Example' className='hero-image' />
        <figcaption className='image-title'>Example Image</figcaption>
      </figure>
    </div>
  );
}

export default AboutUs;
